import React from 'react'
import ArtworchLight from '../../../assets/img/logo_light.svg'
import {Link} from "react-router-dom";
import IconButton from "@material-ui/core/IconButton";
import styled from 'styled-components'

const LogoStyled = styled(({className, ...props}) => {
    return (
        <IconButton className={className}
                    component={Link} to="/" color='inherit' disableRipple={true}
        >
            {
                <img src={props.src} width={props.size} height={props.size} alt={props.alt}/>
            }
        </IconButton>
    )
})`
margin-right: 4px;
`

function Logo(props) {

    return (
        <LogoStyled src={ArtworchLight} size={32} alt="artworch"/>
    )
}

export default Logo
